import React, { Component } from 'react';
import {
	BrowserRouter as Router,
	Routes,
	Route,
	NavLink,
	Outlet,
	useParams,
	useLocation,
} from 'react-router-dom';
import style from './ProjectSubNav.module.css';

const ProjectSubNav = (props, { projectClick }) => {
	let projects = props.projects;

	const handleProjectClick = (slug) => {
		props.projectClick(slug.target.value);
	};

	return (
		<div>
			<div>
				{projects.map((project) => (
					<NavLink to={`/project/${project.slug}/`} onClick={props.handleClick}>
						<div
							onClick={() => {
								projectClick();
							}}
						>
							{project.title}
						</div>
					</NavLink>
				))}
			</div>
		</div>
	);
};

export default ProjectSubNav;
